import { Container, Navbar } from "react-bootstrap";

const Header=()=>{
    return <Navbar bg="dark" variant="dark" expand="lg">
        <Container>
            <Navbar.Brand>React</Navbar.Brand>
        </Container>
    </Navbar>
}
export default Header;
